import { Link } from "react-router-dom";
import logo from "./logo.png";
import back from "./Svg/back-arrow.svg";
import { Navbar, Nav } from "react-bootstrap";
import Backarrow from "./svgComponent/BackArrow";
import "bootstrap/dist/css/bootstrap.min.css";
import "./mySass.scss";

const navbar = () => {
  return (
    <div id="fullBar">
      <Navbar id="mainBar" bg="myLight" expand="md" collapseOnSelect>
        <Navbar.Brand styles={{color: 'black'}}>
          {/* <img id="mainLogo" src={backarrow} width="60px"></img> */}
          <Backarrow />
        </Navbar.Brand>

        <div id="logo-text">
          <h2>NETFLIX & CHILL</h2>
        </div>

        <Navbar.Toggle />
        <Navbar.Collapse id="coll">
          <Nav id="barItems">
            <Link to="/">Home</Link>
            <Link to="/contact">Contact</Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default navbar;
